import React, { useState, useEffect } from "react";
import "./home.css";

// Import images
import image1 from './images/slider1.jpg'; // Replace with your image path
import image2 from './images/slider2.jpg'; // Replace with your image path
import image3 from './images/slider3.jpg'; // Replace with your image path

const ProfileCards = () => {
  const images = [image1, image2, image3];

  return (
    <div className="container_h1 mx-auto p-4 grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-4">
      {images.map((image, index) => (
        <div
          key={index}
          className={`profile-card card-${index + 1}`}
          style={{
            backgroundImage: `url(${image})`,
            backgroundRepeat: 'no-repeat',
            backgroundPosition: 'center',
            backgroundSize: 'cover'
          }}
        >
          {/* Optional content here */}
          <div className="content">
            <span>Card {index + 1}</span>
          </div>
        </div>
      ))}
    </div>
  );
};

export default ProfileCards;
